package com.arquitecturajava;



public class CompararNumeros {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int numero1=2;
		int numero2=3;
		int numero4=5;
		int numero6=5;
		System.out.println(numero1=numero2);
		System.out.println(numero1==numero2);
		System.out.println(numero4!=numero6);
		System.out.println(numero4==numero6);
	}

}
